package com.apl.lms.label.print.service.impl;

import com.apl.lib.constants.CommonStatusCode;
import com.apl.lib.exception.AplException;
import com.apl.lms.label.print.bo.ShipOrderBo;
import com.apl.lms.label.print.utils.ConvertImageUtil;
import org.dom4j.Element;
import java.io.File;
import java.io.IOException;
import java.text.SimpleDateFormat;

/**
 * @author hjr start
 * @Classname UPSLabelPrintServiceImpl
 * @Date 2021/1/6 21:34
 */
public class FEDEXLabelPrintServiceImpl {


    public static void main(String[] args) throws IOException {
        StringBuffer str = new StringBuffer();
        str.append("");
        str.append("");
        str.append("");
        String base64Code = "";
        str.append(base64Code);

        String fileSaveFullPath = "G:/waybill/label/2020-12-21/Fedex-label.pdf";
        ConvertImageUtil.base64GeneratorImage(str.toString(), fileSaveFullPath);
    }

    /**
     * 创建fedex label pdf
     * @param xmlFile
     * @return
     */
    public static String buildLabel(File xmlFile) {

        String labelFileFullPath = extractFedexLabelBase64Code(xmlFile);

        return labelFileFullPath;
    }

    /**
     * 创建fedex invoice pdf
     * @param xmlFile
     * @return
     */
    public static String buildInvoice(File xmlFile) {

        String invoiceFileFullPath = extractFedexInvoiceBase64Code(xmlFile);

        return invoiceFileFullPath;
    }

    /**
     * 获取fedex发票
     * @param labelPath
     * @param shipOrderBo
     * @return
     */
    public static String getFedexInvoice(String labelPath, ShipOrderBo shipOrderBo){

        SimpleDateFormat simpleDateFormat = new SimpleDateFormat("yyyy-MM-dd");
        String orderTimeStr = simpleDateFormat.format(shipOrderBo.getOrderTime());
        String filePath = labelPath + orderTimeStr + "/" + shipOrderBo.getTrackingSn() + "-invoice.xml";

        if(!ConvertImageUtil.existsFile(filePath)){
            String receivingTime = simpleDateFormat.format(shipOrderBo.getReceivingTime());
            filePath = labelPath + receivingTime + "/" + shipOrderBo.getTrackingSn() + "-invoice.xml";
            if(!ConvertImageUtil.existsFile(filePath))
                return null;
        }

        File xmlFile = new File(filePath);
        String fileFullPath = extractFedexInvoiceBase64Code(xmlFile);
        return fileFullPath;
    }

    /**
     * 从xml中提取label  base64编码
     * @param xmlFile
     */
    public static String extractFedexLabelBase64Code(File xmlFile){

        String saveFileFullPath;

        try {

            Element rootNode = ConvertImageUtil.createXmlElement(xmlFile);
            String xmlFileAbsolutePath = xmlFile.getAbsolutePath();
            //寻找base64对应的标签
            String base64Data = rootNode.element("Body").element("ProcessShipmentReply").element("CompletedShipmentDetail")
                    .element("CompletedPackageDetails").element("Label").element("Parts").element("Image").getText();

            //组装文件全路径
            saveFileFullPath = xmlFileAbsolutePath.replaceAll(".xml", "-label.pdf");
            //base64转图片并写出到指定路径
            boolean isSuccess = ConvertImageUtil.base64GeneratorImage(base64Data, saveFileFullPath);
            if(!isSuccess)
                throw new AplException(CommonStatusCode.SYSTEM_FAIL);

        } catch (IOException e) {

            throw new AplException(e.getMessage(), e.getCause().toString());
        }
        //成功
        return saveFileFullPath;
    }

    public static String extractFedexInvoiceBase64Code(File xmlFile){

        String saveFileFullPath;

        try {
            Element rootNode = ConvertImageUtil.createXmlElement(xmlFile);
            String xmlFileAbsolutePath = xmlFile.getAbsolutePath();
            //寻找base64对应的标签
            String base64Data = rootNode.element("Body").element("ProcessShipmentReply").element("CompletedShipmentDetail").element("ShipmentDocuments")
                    .element("Parts").element("Image").getText();

            //组装文件全路径
            saveFileFullPath = xmlFileAbsolutePath.replaceAll(".xml", ".pdf");

            //base64转图片并写出到指定路径
            boolean isSuccess = ConvertImageUtil.base64GeneratorImage(base64Data, saveFileFullPath);
            if(!isSuccess)
                throw new AplException(CommonStatusCode.SYSTEM_FAIL);

        } catch (IOException e) {
            throw new AplException(e.getMessage(), e.getCause().toString());
        }

        //成功
        return saveFileFullPath;
    }
}
